import React from "react";
import Sidebar from "../components/Sidebar";
import { Outlet } from "react-router";
import { Box, Grid } from "@mui/material";

const Adminlayout = () => {
  return (
    <>
      <Grid container>
        <Grid item xs={2}>
          <Sidebar/>
        </Grid>
        <Grid item>
          <Box sx={{p:10}}>header</Box>
        </Grid>
      </Grid>
    </>
  );
};

export default Adminlayout;
